import React from 'react';

const FlagBs = props => (
  <svg viewBox="0 0 600 300" {...props}>
    <path fill="#00abc9" d="M0 0h600v300H0z" />
    <path fill="#fae042" d="M0 100h600v100H0z" />
    <path d="M0 0v300l259.808-150z" />
  </svg>
);

export default FlagBs;
